   out = (sample + fix_mul(_ctx.decay,_ctx.buffer[_ctx.pos]));
   _ctx.buffer[_ctx.pos] = out;
   _ctx.pos = (1 + _ctx.pos);
   _ctx.pos = (_ctx.pos % _ctx.delay);
